import classes from "./nav.module.css";
const Nav = () => {

    const isAuthenticated = () => {
        let token = localStorage.getItem("profilesAuthToken")
        return token !== null
      }

      isAuthenticated();
  return (
    <div className={classes.nav}>
      <h1 className={classes.navTitle}>Profiles</h1>
      {isAuthenticated && <button className={classes.logOutButton}>Log Out</button>}
    </div>
  );
};

export default Nav;
